import React from 'react'

const About = props => {
  return (
    <div>
      <h1>About</h1>
      <p className="mb-2">This is a full stack React app for keeping contacts.</p>
      <p className="mb-2">
        Version: <strong className="badge">1.0.0</strong>
      </p>
    </div>
  )
}

export default About
